description:
My Girlfriends Mother 9 (Sweet Sinner) WEB-DL Split Scenes (NEW 2015) [.mp4]

Tyler's studious girlfriend, Sophie isn't giving him any loving and he's becoming more and more attracted to her wild and free Mom, Heather. Heather's boyfriend is Tyler's age. His sister is dating a much older man. Even a night with an escort doesn't take Tyler's mind off Heather. Will Sophie's competitive nature kick in if he seduces her mother?? India Summer stars as Heather, Jodi Taylor is Sophie and Tyler is Tyler Nixon. With Valentina Nappi, Zoey Monroe, Danny Mountain and Steven St. Croix.

